    true,nt"url": null,nt"notes": "This report, which is part of a four-volume
    series, provides a cross-national comparison of the social security systems in 48
    countries in Africa. It summarizes the five main social insurance programs in those
    countries: old-age, disability, and survivors; sickness and maternity; work injury;
    unemployment; and family allowances. The other regional volumes in the series focus
    on the social security systems of countries in Europe, Asia and the Pacific, and
    the Americas. Together, the reports provide important information for researchers
    and policymakers who are reviewing different ways of approaching social security
    challenges and adapting the systems to the evolving needs of individuals, households,
    and families.",nt"license_title": "Creative Commons CCZero",nt"extras":
